    height:800,
    
},

index1:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    height:300,
    justifyContent:'center',
    // width: 300,
},

indexImg:{
    alignItems:'center',    
},


dados:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    justifyContent:'center',
    height:800,
},

dadosText:{
    fontWeight:'bold',
    fontSize: 25,
    marginBottom:50,
},

dadosText1:{
    color:'#5C6B73',
    fontWeight:'100',
    fontSize: 25,
},
dadosTextInput:{
    borderColor:'#C2DFE3',
    borderStyle:'solid',
    borderWidth:1,
    margin:10,
},

dadosTouch:{
    alignItems:'center',
    backgroundColor:'#5C6B73',
    borderStyle:'solid',
    borderWidth:1,
    borderRadius:10,
    height:30,
    justifyContent:'center',
    marginTop:30,
    marginBottom:100,
    width:80,
},

dadosTouchText:{
    color:'#E0FBFC',
    fontSize:20,
    fontWeight:'bold',
},

dicas:{
    alignItems:'center',
    backgroundColor:'#E0FBFC',
    justifyContent:'center',
    height:800,

},
    
dicasImg:{
    height:100,
    width:100,
},

dicasText:{
    alignItems:'center',
    fontWeight:'bold',
    fontSize: 20,
    justifyContent:'center',
    marginLeft:70,
    width:400,
},

dicasText1:{
    alignItems:'center',
    fontSize: 15,
    justifyContent:'center',
    marginLeft:70,
    width:350,
},


dicasFlex:{
    backgroundColor:'yellow',
    flex:1,
    flexDirection: 'row',
},

dicasFlex1:{
    backgroundColor:'red',
    flex:8,
    fontSize:18,
    fontWeight:'bold',
    height:300,
    padding:20,
},


dicasFlex2:{
    backgroundColor:'green',
    flex:2,
    height:50,
},

